import React from "react";

const Header = () =>{

        const cutTime = new Date().toLocaleDateString();
    return(

        <>

            <div className="main_content">   
            <div className="header">       
              <div className="content_box">              
                  
                    <h1>Google Keep<span>{cutTime} </span></h1>
                  
              </div>  
            </div>
            </div>
            


        </>
    );
}
export default Header;
